pragma solidity ^0.4.23;

import "../ProductionRegistry/IProductionRegistry.sol";
import "../ProductionContract.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "zeppelin-solidity/contracts/math/SafeMath.sol";
import "zeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "./IProductionFactory.sol";
import "../Upgradeability/OwnableUpgradeableImplementation/OwnableUpgradeableImplementation.sol";

contract ProductionFactory is IProductionFactory, OwnableUpgradeableImplementation {
	using SafeMath for uint;

	address public _productionRegistry;
	address public _tokenContract;

	bool internal contractInited;

	struct OrderHistoryEntry {
		uint orderTime;
		address orderContract;
		uint registryVersion;
	}

	mapping(address => bool) public _isBlacklisted;
	mapping(address => OrderHistoryEntry[]) public _ordersHistory;

	modifier productionRegistrySet() {
		require(_productionRegistry != address(0), "The production registry address was not set");
		_;
	}

	modifier notBlacklisted() {
		require(!_isBlacklisted[msg.sender], "The message sender is blacklisted");
		_;
	}

	modifier onlyNotInited() {
        require(!contractInited, "The registry was inited");
        _;
    }

    modifier onlyInited() {
        require(contractInited, "The registry was not inited");
        _;
    }

	function init(address inTokenContract) onlyNotInited public {
		OwnableUpgradeableImplementation.init();
		_tokenContract = inTokenContract;
		contractInited = true;
	}

	function tokenContract() public view returns(address) {
		return _tokenContract;
	}

	function setTokenContract(address inTokenContract) public onlyInited onlyOwner {
		require(inTokenContract != address(0), "Invalid address for the token contract");
		_tokenContract = inTokenContract;
	}

	modifier onlyToken() {
		require(msg.sender == _tokenContract);
		_;
	}

	function productionRegistry() public view returns(address) {
		return _productionRegistry;
	}

	function setProductionRegistry(address registry) public onlyInited onlyOwner {
		require(registry != address(0), "Invalid address for registry contract");
		_productionRegistry = registry;
	}

	function isBlacklisted(address blacklistedAddress) public view returns(bool) {
		return _isBlacklisted[blacklistedAddress];
	}

	function calculateServiceTax(uint _quantity, uint _pricePerUnit) public view returns(uint) {
		IProductionRegistry registry = IProductionRegistry(_productionRegistry);
		return registry.calculateServiceTax(_quantity, _pricePerUnit);
	}

	function createContractForConsumer(address _consumer, address _manufacturer, uint _quantity, ProductionContract.PRODUCT_FORM _form, string _engravingText, uint _pricePerUnit, string _shipmentAddress, bytes32 _freightAgent) public payable onlyToken returns(address) {
		require(tx.origin == _consumer, "The initiator of this contract is not the consumer");
		return createOrder(_consumer, _manufacturer, _quantity, _form, _engravingText, _pricePerUnit, _shipmentAddress, _freightAgent);
	}

	function createContract(address _manufacturer, uint _quantity, ProductionContract.PRODUCT_FORM _form, string _engravingText, uint _pricePerUnit, string _shipmentAddress, bytes32 _freightAgent) public payable productionRegistrySet notBlacklisted returns(address) {
		return createOrder(msg.sender, _manufacturer, _quantity, _form, _engravingText, _pricePerUnit, _shipmentAddress, _freightAgent);
	}

	function createOrder(address _consumer, address _manufacturer, uint _quantity, ProductionContract.PRODUCT_FORM _form, string _engravingText, uint _pricePerUnit, string _shipmentAddress, bytes32 _freightAgent) internal productionRegistrySet notBlacklisted returns(address) {
		uint totalETHCost = _quantity.mul(_pricePerUnit);
		require(msg.value >= totalETHCost, "Not enough value supplied");
		uint serviceTransactionTax = calculateServiceTax(_quantity, _pricePerUnit);
		ERC20 tokenInterface = ERC20(_tokenContract);
		uint orderAllowance = tokenInterface.allowance(_consumer, address(this));
		require(orderAllowance >= serviceTransactionTax, "Not enough allowance");
		require(tokenInterface.transferFrom(_consumer, address(this), serviceTransactionTax), 'Could not withdraw tokens for service tax');

		ProductionContract orderContract = (new ProductionContract).value(totalETHCost)(
			_productionRegistry,
			_consumer,
			_manufacturer,
			_quantity,
			_form,
			_engravingText,
			_pricePerUnit,
			_shipmentAddress,
			_freightAgent);
		IProductionRegistry(_productionRegistry).addOrder(_consumer, _manufacturer, orderContract, _pricePerUnit);

		_consumer.transfer(msg.value.sub(totalETHCost));

		addToOrdersHistory(_consumer, orderContract);

		emit LogOrderCreated(_manufacturer, orderContract);

		return address(orderContract);
	}

	function ordersHistory(address historyAddress, uint index) public view returns(uint, address, uint) {
		OrderHistoryEntry storage e = _ordersHistory[historyAddress][index];
		return (e.orderTime, e.orderContract, e.registryVersion);
	}

	function addToOrdersHistory(address _consumer, address orderContract) internal {
		IProductionRegistry registry = IProductionRegistry(_productionRegistry);
		_ordersHistory[_consumer].push(OrderHistoryEntry({orderTime: now, orderContract: orderContract, registryVersion: registry.getRegistryVersion()}));
	}

	function getOrdersHistoryLength(address consumer) public view returns(uint) {
		return _ordersHistory[consumer].length;
	}

	function blacklist(bool add, address user) private onlyOwner returns(bool) {
		_isBlacklisted[user] = add;
		emit LogBlacklisted(user, add);
	}

	function addToBlacklist(address user) external returns(bool) {
		return blacklist(true, user);
	}

	function removeFromBlacklist(address user) external returns(bool) {
		return blacklist(false, user);
	}

	function withdraw() external onlyOwner {
		ERC20 tokenInterface = ERC20(_tokenContract);
		uint withdrawBalance = tokenInterface.balanceOf(address(this));
		require(tokenInterface.transfer(owner, withdrawBalance));
		emit LogWithdraw(owner, withdrawBalance);
	}

	function withdrawTo(address to) external onlyOwner {
		ERC20 tokenInterface = ERC20(_tokenContract);
		uint withdrawBalance = tokenInterface.balanceOf(address(this));
		require(tokenInterface.transfer(to, withdrawBalance));
		emit LogWithdraw(to, withdrawBalance);
	}
}
